       id="text48"><tspan
         
         y="0"
         id="tspan46">1. Prøvens niveau og bedømmelsen</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,55.0157,507.1496)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:10px;font-family:'Minion Pro';-inkscape-font-specification:MinionPro-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text58"><tspan
         
         y="0"
         id="tspan50">Prøven i læseforståelse og skriftlig fremstilling ved Prøve i Dansk 2 tester </tspan><tspan
         
         y="14"
         id="tspan52">dansksproglige færdigheder på et niveau, der relaterer til Threshold (B1),</tspan><tspan
         
         y="28"
         id="tspan54">jf. kompetenceskalaen, Common European Framework of Reference (CEFR).</tspan><tspan
         
         y="56"
         id="tspan56">Besvarelserne i </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,117.3247,451.1496)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:10px;font-family:'Minion Bold';-inkscape-font-specification:Minion-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text62"><tspan
         
         y="0"
         id="tspan60">læseforståelse</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,177.0647,451.1496)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:10px;font-family:'Minion Pro';-inkscape-font-specification:MinionPro-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text80"><tspan
         
         y="0"
         id="tspan64">bedømmes ved hjælp af rettenøglerne i dette hæfte.</tspan><tspan
         
         y="28"
         id="tspan66">Ved opgaver, der besvares med kort-svar (opgave 1), er kravet, at besvarelsen skal </tspan><tspan
         
         y="42"
         id="tspan68">være fyldestgørende og dækkende, og at der ikke må være medtaget noget, som </tspan><tspan
         
         y="56"
         id="tspan70">ikke hører med til svaret. I rettenøglen angives der mindst ét korrekt svar, men der </tspan><tspan
         
         y="70"
         id="tspan72">kan være andre svar, som er korrekte. Det afgøres af censor og eksaminator.</tspan><tspan
         
         y="98"
         id="tspan74">Der gives point for de enkelte svar. Pointene gives kun som hele point. Det samlede </tspan><tspan
         
         y="112"
         id="tspan76">pointtal for alle svarene omsættes ved hjælp af en omregningstabel til en karakter. </tspan><tspan
         
         y="140"
         id="tspan78">Besvarelserne i </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,117.3247,311.1496)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:10px;font-family:'Minion Bold';-inkscape-font-specification:Minion-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text84"><tspan
         
         y="0"
         id="tspan82">skriftlig fremstilling</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,203.8727,311.1496)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:10px;font-family:'Minion Pro';-inkscape-font-specification:MinionPro-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text100"><tspan
         
         y="0"
         id="tspan86">bedømmes på grundlag af bedømmelses-</tspan><tspan
         
         y="14"
         id="tspan88">kriterier.</tspan><tspan
         
         y="42"
         id="tspan90">Umiddelbart efter prøveafholdelsen modtager de beskikkede censorer og den prø-</tspan><tspan
         
         y="56"
         id="tspan92">veafholdende udbyders leder resultatet af forcensuren sammen med en omregnings-</tspan><tspan
         
         y="70"
         id="tspan94">tabel fra point til karakterer for læseforståelsen. Af forcensuren fremgår det, om der </tspan><tspan
         
         y="84"
         id="tspan96">skal tages særlige hensyn ved bedømmelsen. Censor sikrer sig, at eksaminator er </tspan><tspan
         
         y="98"
         id="tspan98">orienteret om resultatet af forcensuren, inden voteringen begynder.</tspan></text>
